import React from "react";
import '../style.css';
class Shows extends React.Component {
  render() {
    return (
      <div>
      <h2><font color ="white" size = "50">Shows</font></h2>
      <button className="button2" onClick={() => window.location.href='PlayVideo'}>PlayVideo</button>
      </div>
    );
  }
}
export default Shows
